import React from 'react';

import Api from './api';

const Methods = () => {
  
    Api.map((curEle)=>{
      return ( 
        <>

          <h1>{curEle.id} </h1>
          <h1>{curEle.name} </h1>
          <h3>{curEle.Contact}</h3>
        </>
          )
    });
  
}

export default Methods;
